    svg#freepik_stories-version-control:not(.animated) .animable {
        opacity: 0;
    }

    svg#freepik_stories-version-control.animated #freepik--Floor--inject-53 {
        animation: 1s 1 forwards cubic-bezier(.36, -0.01, .5, 1.38) lightSpeedRight;
        animation-delay: 0s;
    }

    svg#freepik_stories-version-control.animated #freepik--Plant--inject-53 {
        animation: 1s 1 forwards cubic-bezier(.36, -0.01, .5, 1.38) zoomOut;
        animation-delay: 0s;
    }

    svg#freepik_stories-version-control.animated #freepik--Screens--inject-53 {
        animation: 1s 1 forwards cubic-bezier(.36, -0.01, .5, 1.38) slideDown;
